import './RegistrationForm.css'

function RegistrationForm(){
    return(
        <div className="form">
            <form action="">
                <label htmlfor="username">Username</label>
                <input type="name" id="name"></input>
            </form>
            

        </div>
    );
};
export default RegistrationForm;
